import axios from "axios";
import { useEffect, useState } from "react";
import "./Tracks.css";

function Tracks() {
  const [cards, setCards] = useState([]);

  const getData = async () => {
    const data = await axios({
      method: "get",
      url: "http://localhost:8000/cards",
    });
    setCards(data.data);
  };

  useEffect(() => {
    getData();
  }, []);

  return (
    <>
      {cards.map((obj) => {
        <div className="track">
          <div className="wrapper">
            <div className="img">
              <img src={props.img} alt="" />
            </div>
            <div className="content">
              <header>
                <h3>{props.title}</h3>
                <i className="fa-solid fa-ellipsis"></i>
              </header>
              <time>{props.currentTime}</time>
              <span className="last-time">{props.previousTime}</span>
            </div>
          </div>
        </div>;
      })}
    </>
  );
}

export default Tracks;
